INSERT INTO `doctor` (`doctor_id`, `doctor_name`, `doctor_email`, `doctor_password`, `doctor_signature`, `doctor_phone`, `doctor_image`, `doctor_address`, `doctor_bio`, `category_id`, `doctor_location`, `doctor_activation`, `doctor_status`, `doctor_date_created`, `doctor_gender`, `doctor_qualifications`, `doctor_specialty`, `doctor_license`, `doctor_statement`, `doctor_experience`, `doctor_rate`) VALUES
('2DE0jeYUufC', 'Djihad Bizimana', 'test22@gmail.com', '$2y$11$NHJnqtVe6MVcEPv90Cahku0cuor/eJA6BdaUnT4.QUPo6SynpcCFy', NULL, '+254742179750', 'TherapyImage20230814at063847pm3lhy8quw.jpeg', '', 'I am a medical psychologist by profession committed to helping individuals, couples, and families gain better balance and improve their mental well-being. If you\\&#039;re struggling with drug and substance use, anxiety, and gender-based violence, I can help you navigate through this and offer a path forward.', '1xm8GTDWZsq|3NJjfcrM1FW|MNGK5P6SZAr', 'Kisumu', 'activated', 'active', '2023-02-01 11:26:23', 'male', 'BSc Medical Psychology', 'General Psychotherapy, Addiction Counselling, Gender Based Counselling, Developmental Psychology', '2292', 'Healing starts with you.', '3', 4500),
('2p7HXxnlVSK', 'Steve Rubanguka', 'test33@gmail.com', '$2y$11$NHJnqtVe6MVcEPv90Cahku0cuor/eJA6BdaUnT4.QUPo6SynpcCFy', NULL, '+254722273610', 'TherapyImage20230814at063934pm2hqy3rs0.jpeg', '', 'I am a highly self-motivated and ambitious person, who possesses interpersonal skills and communication skills, is very dynamic, and is always prepared to face challenges. I have 13 years of MHPSS experience 7 of which have been used in trauma therapy and rehabilitation.', '5SmYyjWBAoG', 'Mombasa', 'activated', 'active', '2023-02-01 10:59:27', 'male', 'BA Counselling Psychology', 'General Psychotherapy, Addiction Counselling, Trauma, Special Population Psychology, Organizational Psychology', 'KCPA/1113/10', 'Mental wellness', '3', 4000),
('2uNpbEZ0Rht', 'Dominique Savio Nshuti', 'test44@gmail.com', '$2y$11$NHJnqtVe6MVcEPv90Cahku0cuor/eJA6BdaUnT4.QUPo6SynpcCFy', NULL, '+254 714 000522', 'PsychImage20230814at064021pmk95c6by0.jpeg', 'Nairobi', 'I am passionate about helping people navigate through life\\&#039;s challenges and find their inner strength. My expertise lies in abnormal psychology, organizational psychology, general psychotherapy, child psychology, depression, suicide prevention, and trauma. I believe that healing is a holistic process, which is why I incorporate various forms of therapy such as art, music, movement, and nature into my practice. By embracing our unique qualities and potential, we can unlock the power to heal and lead fulfilling lives.', '9m5YMA3BHjL', 'Eldoret', 'activated', 'active', '2023-02-01 10:48:22', 'male', 'MSc Clinical Psychology', 'Organizational Psychology, General Psychotherapy, Child Psychology, Depression, Suicide Prevention, Trauma', '5218', 'Healing is not just about fixing what\\&#039;s broken, but embracing our uniqueness and unlocking our true potential.', '3', 4000),
('4KnW7mNrHdY', 'Christina Ishimwe', 'test55@gmail.com', '$2y$11$NHJnqtVe6MVcEPv90Cahku0cuor/eJA6BdaUnT4.QUPo6SynpcCFy', NULL, '+254717714170', 'MentalImage20230814at064051pm07uqk5t4.jpeg', '', 'I am a qualified psychologist with training and experience in providing Mental Health services to Individuals and groups in pursuit of holistic mental health. I have training in a variety of techniques and strategies in working with cases of anxiety, depression, substance addiction, psychotic disorders and trauma-related conditions.', '3NJjfcrM1FW|9m5YMA3BHjL|MNGK5P6SZAr|zuEysB6krMi', 'Nanyuki', 'activated', 'active', '2023-02-01 12:07:06', 'female', 'BA Counselling Psychology', 'General Psychotherapy, Anxiety, Depression, Trauma, Addiction', 'KCPA/6532/21', '\\&quot;You don\\&#039;t have to struggle in silence, for anything that is mentionable is manageable. When we talk about our feelings, they become less overwhelming, upsetting, and scary.\\&quot;', '3', 6000),
('7cDtAlKLsSI', 'Imanarakoze Patrice', 'pmanyara97@gmail.com', '$2y$11$NHJnqtVe6MVcEPv90Cahku0cuor/eJA6BdaUnT4.QUPo6SynpcCFy', 'signatures/7cDtAlKLsSI.png', '+254703296082', 'MentalImage20230814at052634pmzf1dpu3h.png', '345 Kikuyu', 'I am a psychologist, specializing in Clinical Psychology and experienced in working with children, adolescents and young people.', '3NJjfcrM1FW|5SmYyjWBAoG|9m5YMA3BHjL|zuEysB6krMi', 'Nairobi', 'activated', 'active', '2023-02-01 12:14:38', 'male', 'MA Clinical Psychology Candidate', 'Adolescent/ Youth Counselling, Anxiety, Depression, Trauma, Addiction', 'KPsyA/AM/142/2020', 'Healing is a rewarding journey and your first step to getting help is the purest form of courage.', '3', 14000),
('BNsKmCFWrQz', 'Bonheur Mugisha', 'test66@gmail.com', '$2y$11$NHJnqtVe6MVcEPv90Cahku0cuor/eJA6BdaUnT4.QUPo6SynpcCFy', NULL, '+254791543500', 'PsychImage20230814at064136pmzkr82unf.jpeg', '23987-00100,Nairobi', '5 years of experience as a psychologist,trainer and mental health advocate. I have expertise in child and adolescent Psychology, Trauma Counseling including that of Gender-based Violence Survivors, and working with adults experiencing challenges such as addiction, mental illness, and psychosocial stressors. clinical research. I am passionate about the provision of psychological care and working with people suffering from mental illnesses and affected families to enable everyone to lead healthy lives.', 'g0Uy2VmD9ql', 'Nairobi', 'activated', 'active', '2023-02-01 11:43:56', 'male', 'Bachelor of Arts, Counselling Psychology', 'Anxiety, Depression, Child/ Adolescent Disorders, Substance Use Disorders', 'KCPA/06678/2021', 'Your mental health is everything â€“ prioritize it. Make the time like your life depends on it, because it does.', '3', 4000),
('DBk3Ro29htf', 'Fatima Sahabo', 'test77@gmail.com', '$2y$11$NHJnqtVe6MVcEPv90Cahku0cuor/eJA6BdaUnT4.QUPo6SynpcCFy', NULL, '', 'PsychImage20230814at064209pmaf6spio4.jpeg', '', 'Hi! I\\&#039;m Jennifer. If you are looking for a doctor to help you make your life more fulfilling, then you\\&#039;ve found the right person!', 'zuEysB6krMi', 'Nairobi', 'activated', 'active', '2023-02-01 10:30:54', 'female', 'M.A. Counselling Psychology', 'General Psychotherapy, Personal Development, Anxiety, Depression, Addiction', 'KCPA/6182/21', 'Take charge of your life, starting with your mental health. PsychX is here to help!', '3', 1200),
('Fb3l9TcLHvN', 'Muhadjiri Hakizimana', 'test88@gmail.com', '$2y$11$NHJnqtVe6MVcEPv90Cahku0cuor/eJA6BdaUnT4.QUPo6SynpcCFy', NULL, '+254703554131', 'MentalImage20230814at064303pm96045axf.jpeg', '', 'I am a licensed medical psychologist. I have 3 years of experience, offering individual and group therapy, organizing and facilitating group therapy sessions, and offering mental health talks. I am passionate about creating mental health literacy at the community level with a focus on promotive and preventive health, not just curative and rehabilitative health.', '5SmYyjWBAoG', 'Nairobi', 'activated', 'active', '2023-02-01 11:05:10', 'male', 'Bsc Medical Psychology', 'Psychological  Assessments,Psychotherapy(individual therapy),Psychoeducation about mental health  conditions', 'RMedPay/2169/69', 'Mental health Matters.', '3', 16000),
('sYiIfO0mWh2', 'John Kim', 'kimatrocious@gmail.com', '$2y$11$NHJnqtVe6MVcEPv90Cahku0cuor/eJA6BdaUnT4.QUPo6SynpcCFy', NULL, '+254724989901', 'PsychImage20230814at063806pmxgwi1n2h.jpeg', '', 'I am an avid mental health advocate with 8 years of experience and am Passionate about meeting the mental well-being needs of adolescents and young adults and supporting them to navigate through life challenges.', 'K5HNOvLMlZ8|5SmYyjWBAoG|g0Uy2VmD9ql', 'Nairobi', 'activated', 'active', '2023-02-01 10:22:23', 'female', 'BA Counselling Psychology', 'General Psychotherapy, Adolescent Counseling.', 'KAPC/MN01289/11/21', 'I love working with people from different cultures and believe each youth has the potential to achieve their life goals without the burden of pain and/or the past.', '2', 5000),
('THP20230702lvnUipA', 'Olivier Kwizera', 'test99@gmail.com', '$2y$11$MYavRWZF177BMcieiLB6bOeuOw116scqA.jw1YxKagRHxIRcDZWBy', NULL, '0704322307', 'HealthImage20230814at062242pmlkpo1i8e.png', 'Nairobi', 'A seasoned Clinical Psychologist with a thriving interest in helping people across all ages reach their mental health and healing goals using holistic approach.', 'g0Uy2VmD9ql', 'Nairobi', 'activated', 'active', '2023-07-02 23:01:47', 'Female', 'MSc Clinical Psychology', 'Clinical mental health cases', 'CPAK/008/2022', 'A seasoned Clinical Psychologist with a thriving interest in helping people across all ages reach their mental health and healing goals using holistic approach.', '2', 2000),
('THP20230702rudDT81', 'Linda Iraguha', 'test11@gmail.com', '$2y$11$gCQw75w7kLEyXAF8SCCgE.tZx7AwBPsjS82.K4R7hVLy0crZ1UuSm', NULL, '0701215458', 'HealthImage20230814at064530pm4bzc978p.jpeg', 'Nakuru', 'I am a Licensed Psychologist who is very passionate about mental health and well-being and loves working with adolescents and adults alike. She is empathetic, patient, and a good listener.', '1xm8GTDWZsq|K5HNOvLMlZ8|5SmYyjWBAoG|3NJjfcrM1FW|zuEysB6krMi', 'Nakuru', 'activated', 'active', '2023-07-02 22:49:51', 'Female', 'Undergraduate Degree', 'Depression, Anxiety, Personal development therapy, Loss and Grief counseling, Trauma counseling, Addiction counseling', 'KCPA/0713/22', 'Linda Atuti is a Licensed Psychologist who is very passionate about mental health and well-being and loves working with adolescents and adults alike. She is empathetic, patient, and a good listener.', '2', 3000),
('THP20230801ac7mEDb', 'Bray Odhiambo Owiti', 'test100@gmail.com', '$2y$11$70nKK1tHSf4t47zGK5sIGu16VBz4dv1r05XfJdod6mmnUnU7NcXIK', NULL, '0702670557', 'HealthImage20230814at064612pm52c1gsm8.jpeg', 'Nairobi', 'Working with you to foster and nurture your mental well-being, one therapy session at a time.', '5SmYyjWBAoG|g0Uy2VmD9ql', 'Nairobi', 'activated', 'active', '2023-08-01 12:49:48', 'female', 'BA Counselling Psychology', 'BA Counselling Psychology', 'KPsy/AM/225/2021', 'Working with you to foster and nurture your mental well-being, one therapy session at a time.', '4', 3000),
('THP20230807KwboyI1', 'Winny Kay', 'doctor@vesencomputing.com', '$2y$11$NHJnqtVe6MVcEPv90Cahku0cuor/eJA6BdaUnT4.QUPo6SynpcCFy', 'signatures/THP20230807KwboyI1.png', '0123456', 'HealthImage20230807at070648pmzu3neofl.png', 'Nairobi', 'Working with you to foster and nurture your mental well-being, one therapy session at a time.', '5SmYyjWBAoG|g0Uy2VmD9ql', 'Nairobi', 'activated', 'active', '2023-08-07 19:06:48', 'Female', 'x', 'x', '0123456', 'x', '19', 10);
